import * as React from 'react';
import { LineChart, Line, CartesianGrid, Tooltip, Legend } from 'recharts'; // Adjust other imports accordingly
import { ChartsXAxis as XAxis, ChartsYAxis as YAxis } from '@mui/x-charts'; // Updated imports

export default function BasicBars() {
  const data = [
    { group: 'group A', values: [4, 1, 2] },
    { group: 'group B', values: [3, 6, 5] },
    { group: 'group C', values: [5, 3, 6] }
  ];

  return (
    <BarChart
      width={500}
      height={300}
      data={data}
      xAxis={<XAxis dataKey="group" />}
      yAxis={<YAxis />}
      margin={{ top: 20, right: 30, bottom: 5, left: 40 }}
    >
      <Bar dataKey="values[0]" stackId="a" fill="#8884d8">
        <LabelList dataKey="values[0]" position="top" />
      </Bar>
      <Bar dataKey="values[1]" stackId="a" fill="#82ca9d">
        <LabelList dataKey="values[1]" position="top" />
      </Bar>
      <Bar dataKey="values[2]" stackId="a" fill="#ffc658">
        <LabelList dataKey="values[2]" position="top" />
      </Bar>
      <Tooltip />
      <Legend />
    </BarChart>
  );
}
